import React, { Component } from 'react'
import { programs } from './UserFunctions'
import "./Programs.css"

class ProgramsList extends Component {
    constructor() {
        super();
        this.state = {
            initial: [],
        }

    }         
    componentDidMount() {
        console.log('mounted')

        programs().then(res => {

            if(!res.error) {
                console.log(this.state.initial)


            } else{
                console.log("error in axios request: apidata")
            }     
        })

    }

    render(){
        return (<h1> hello</h1>)
    }
}

export default ProgramsList
